import '../public/Styles.css';

function Link(props) {
  const logout = () => {
    alert("Sure");
    localStorage.removeItem('user_id');
    window.location.href = "/login";
  };

  return (
    <div className="sec01">
      <div className="side-link">
        <ul className="nav nav-tabs">
          {!props.filter === "sup" && (
            <>
              <li className="nav-item">
                <a className={`nav-link ${props.but === 'dashboard' ? 'active' : ''}`} aria-current="page" href="/dashboard">Dashboard</a>
              </li>
            </>
          )}
          {props.filter === "usr" && (
            <>
              <li className="nav-item">
                <a className={`nav-link ${props.but === 'status' ? 'active' : ''}`} href="/status">Status</a>
              </li>
              <li className="nav-item">
                <a className={`nav-link ${props.but === 'lodge' ? 'active' : ''}`} href="/lodge">Lodge</a>
              </li>
            </>
          )}
          {props.filter === "adm" && (
            <>
              <li className="nav-item">
                <a className={`nav-link ${props.but === 'grievance' ? 'active' : ''}`} href="/grievance">Grievance</a>
              </li>
              <li className="nav-item">
                <a className={`nav-link ${props.but === 'task' ? 'active' : ''}`} href="/task">Task</a>
              </li>
            </>
          )}
        </ul>
      </div>
      <div className="d-flex align-items-center">
        <span className="mr-2 font-weight-bold bg-light px-3 py-2 rounded border-2 border-black">Welcome, {props.user}</span>
        <button className="btn btn-dark" onClick={logout}>Log out</button>
      </div>
    </div>
  );
}

export default Link;
